import React from 'react';
import { Grid, Image, Segment, Container, Header } from 'semantic-ui-react';
import MovieInfo from '../HeaderSegement/Explore/MovieInfo';
import vk from "../Images/vk.jpg"



const HeaderPart = () => {
    return (
        <React.Fragment>
            <Grid>
                <Grid.Row>
                    <Grid.Column>
                        {/* <Container> */}
                            <Header
                                as='h1'
                                inverted
                                style={{
                                    width: 1024,
                                    height: 320,
                                    display: 'inline-block',
                                    opacity: 0.5,
                                    backgroundImage: `url(${vk})`,
                                    backgroundSize: 'cover',
                                    fontWeight: 'normal',
                                    marginBottom: 0
                                }}
                            >
                                Hello World
                        </Header>
                        {/* </Container> */}
                        <Segment color='transparent' inverted>
                            {/* <Image
                                src={vk}
                                as='a'
                                target='_blank'
                            /> */}
                            <MovieInfo url="https://www.youtube.com/watch?v=3PK2tIyENVA&t=2s" />
                        </Segment>
                    </Grid.Column>
                </Grid.Row>
            </Grid>
        </React.Fragment>
    )
}

export default HeaderPart;
